We are excited to announce our new Executive Director for the Ouray Ice Park: Peter O'Neil.

A little bit about Peter:

Peter was first introduced to the San Juan mountains on a 30-day ski mountaineering course with Colorado Outward Bound School (COBS) back in January of 1974 ‚Äî so, just a few short years ago. Ever since, the transformational power of the outdoors has been a driving force in Peter's life.

Over the past 30+ years, Peter has had many great successes, from graduating Stanford with an MBA to leading several different companies and nonprofit organizations to new heights. And now, after almost 8 years as the Executive Director at COBS, and 11 years as field staff, Peter and his partner Kim have decided it is time to head back down to the San Juans, and join our team at the Ouray Ice Park.

Like COBS, the Ouray Ice Park represents a wonderful opportunity to continue to change lives through challenge and discovery, as climbers discover that there is more in them than they know. At COBS he was committed to serving a broad cross-section of students and making the transformational power of the outdoors inclusive, and accessible to all ‚Äî an aspiration he has for the Ice Park as well.

Peter‚Äôs stoke is high as he joins a committed and passionate staff team, a working board of directors, and a dedicated group of volunteers to continue to create and operate a world-class ice climbing park that inspires and enhances the lives of the communities we serve.

Welcome to the Ouray Ice Park Peter!
